import URL from 'url'

import { SourceMapSupport } from './index.js'

SourceMapSupport.install({ 
  'handleUncaughtExceptions': false, 
  'retrieveSourceMap': function(source) {

    if (/^file:/.test(source)) {
      return SourceMapSupport.retrieveSourceMap(URL.fileURLToPath(source))
    } else {
      return null
    }

  }
})

import Test from 'ava'

Test.before(async (test) => {
  test.context.index = await import('../index.cjs')
})

;[
  'default'
].forEach((name) => {

  Test(name, async (test) => {
    test.truthy(test.context.index[name])
  })

})

const Require = __require

// export default 
module.exports = function(bundler) {
  bundler.addAssetType('pug', Require.resolve('./library/asset.cjs'))
}
